function statusSet(id,t,c,status){
  $('#share'+id).addClass('d-none');
  if($('#qestatus'+id).length > 0){
    $('#l_'+id).removeClass('bg-danger');
    $('#l_'+id).removeClass('bg-warning');
    $('#l_'+id).removeClass('bg-info');
    $('#qestatus'+id).val(status);
    if(status=='delete'){
      $('#l_'+id).addClass('btn-danger');
      $('#untrash'+id).removeClass('d-none');
      $('#delete'+id).addClass('d-none');
      $('#purge'+id).removeClass('d-none');
    }else{
      $('#untrash'+id).addClass('d-none');
      $('#delete'+id).removeClass('d-none');
      $('#purge'+id).addClass('d-none');
    }
    if(status=='published'){
      $('#share'+id).removeClass('d-none');
    }
    if(status=='archived'){
      $('#l_'+id).addClass('bg-info');
    }
    if(status=='unpublished'){
      $('#l_'+id).addClass('bg-warning');
    }
  }else{
    $('#l_'+id).removeClass('delete');
    $('#l_'+id).removeClass('warning');
    $('#l_'+id).removeClass('info');
    if(status=='delete'){
      $('#l_'+id).addClass('delete');
      $('#untrash'+id).removeClass('d-none');
      $('#delete'+id).addClass('d-none');
      $('#purge'+id).removeClass('d-none');
    }else{
      $('#untrash'+id).addClass('d-none');
      $('#delete'+id).removeClass('d-none');
      $('#purge'+id).addClass('d-none');
    }
    if(status=='published'){
      $('#share'+id).removeClass('d-none');
    }
    if(status=='archived'){
      $('#l_'+id).addClass('info');
    }
    if(status=='unpublished'){
      $('#l_'+id).addClass('warning');
    }
  }
}
function addTag(t){
  var eltags=$('#tags').val();
  if(!eltags.includes(t)){
    if(eltags.length > 0){
      eltags+=',';
    }
    if(t=='none'){
      eltags='';
    }else{
      eltags+=t;
    }
    $('#tags').val(eltags);
    $('#tags').trigger('change');
  }
}
