function ipsuMe(el,p){
	if(typeof(phrases)=="undefined")return;
  var ipsum=[];
  if(el=='editor'){
	  var paramnum=p;
	  var paras=p;
    var sentr1=4;
    var sentr2=25;
    var parar1=4;
    var parar2=12;
  }else if(el=='title'){
    var paramnum=1;
    var paras=1;
    var sentr1=1;
    var sentr2=1;
    var parar1=1;
    var parar2=6;
  }else{
    var paramnum=1;
	  var paras=1;
    var sentr1=4;
    var sentr2=25;
    var parar1=4;
    var parar2=12;
  }
	for(i=0;i<paras;i++){
		para="";
		for(j=0;j<ipsumRandom(sentr1,sentr2);j++){
			sent="";
			prevW=-1;
			for(k=0;k<ipsumRandom(parar1,parar2);k++){
				if(sent!="")sent+=" ";
				var rW=ipsumRandom(0,phrases.length);
				while(rW==prevW){rW=ipsumRandom(0,phrases.length);}
        if(phrases[rW])sent+=phrases[rW].trim();
				prevW=rW;
			}
      if(el!='title')sent+=".";
			sent=sent.charAt(0).toUpperCase()+sent.slice(1).toLowerCase();
			if(para!="")para+=" ";
			para+=sent;
		}
		ipsum[ipsum.length]=para;
	}
  if(el=='editor'){
	  var resultHTML='';
	  for(p in ipsum){resultHTML+="<p>"+ipsum[p]+"</p>";}
    $('.summernote').summernote('code',resultHTML);
  }else{
    var resultHTML=$('#'+el);
    for(p in ipsum){resultHTML.val(ipsum[p]);}
  }
}
function ipsumRandom(min,max){return Math.floor((Math.random()*max)+min);}
document.addEventListener('keydown',e=>{
  if(e.ctrlKey && e.key==='s'){
    e.preventDefault();
    if(document.querySelector('.saveall').className.match('btn-danger')){
      document.querySelector('.saveall').click();
    }
  }
});
function seoLink(field,tab){
  var cbarray=document.getElementsByName('tabs');
  for(var i=0;i<cbarray.length;i++){
    cbarray[i].checked=false;
  }
  document.getElementById(tab).checked=true;
  document.getElementById(field).scrollIntoView();
}
